import React from "react";

function HomePage({ isAuthenticated, handleCloneRepos }) {
    return (
        <div className="homepage">
            <h1>Welcome to RAG Codebase App</h1>
            {!isAuthenticated ? (
                <button onClick={() => (window.location.href = "/oauth/github")}>
                    Connect with GitHub
                </button>
            ) : (
                <button onClick={handleCloneRepos}>Clone Repositories</button>
            )}
        </div>
    );
}

export default HomePage;
